import { MenuListItem } from "../MenuListItem/MenuListItem";
import s from "./style.module.css";

export function MenuList (props){
    return <div className={s.container}>
        <MenuListItem onClick={props.onItemclick} difficulty="Low"></MenuListItem>
        <MenuListItem onClick={props.onItemclick} difficulty="Medium"></MenuListItem>
        <MenuListItem difficulty="High"></MenuListItem>
        <MenuListItem difficulty="Insane"></MenuListItem>

    </div>
}
